import React from "react";

import "./NavBarCard.css";

const NavBarCard = () => {

  const items = (prop) => [
    { title: "home", },
    { title: "search",},
  ];

  const classes = "navbar";
  return <div className={classes}>{items.target.title}</div>;
};

export default NavBarCard;
